import React from 'react';
import useSticky from './../../component/hooks/useSticky.js';
import Navbar from './../../component/Navbar/Navbar';
import { Col, Row, Rate, Menu, Dropdown, Button, Input } from 'antd';
import Footer from './../../component/Footer/Footer';
import { UserOutlined,LockOutlined  } from '@ant-design/icons';


const Login = () => {
  const { isSticky, element } = useSticky();

  const suffix = (
    <UserOutlined
      style={{
        fontSize: 16,
        cp: 'black',
      }}
    />
  );

  const suffix2 = (
    <LockOutlined
      style={{
        fontSize: 16,
        cp: 'black',
      }}
    />
  );
  return (
    <div style={{height: '100vh',display:'flex',flexDirection: 'column',justifyContent:'space-between'}}>
      <Navbar sticky={isSticky} />
      <main>
        <section className="welcome">
          <div ref={element} style={{display:'flex',height: '100%',flexDirection:'column',justifyContent:'center',alignItems:'center',paddingTop:'120px'}}>
                <p style={{fontSize:'48px',fontWeight: '700'}}>LOGIN</p>
                <Input 
                size="large"
                     style={{ fontFamily:'Lato',fontWeight:'bold',fontSize:'14px',width: '440px'}}
                    placeholder="Email or phone number"
                    suffix={suffix}
                />
                <Input 
                size="large"
                     style={{ fontFamily:'Lato',fontWeight:'bold',fontSize:'14px',width: '440px',marginTop:'20px'}}
                    placeholder="Password"
                    type="password"
                    suffix={suffix}
                />
                 <div style={{marginTop:'20px'}}>
                    <Button style={{width: '100%',backgroundColor:'#565556',color: '#fff',size:'large',height:'50px'}}>
                        Submit
                    </Button>
                    </div>
          </div>
        </section>
      </main>
      <Footer />
    </div>
  );
};

export default Login;
